import React from "react";
import "../App.css";
import {useNavigate} from "react-router-dom";
import { Button } from "react-bootstrap";

const Myprojects = (props) => {
  const navigate = useNavigate();


  const addproject = (obj) => {
    axios.get()
    axios
      .post(`http://localhost:4000/api/projects/addproject/${obj.owner}`, obj)
      .then((result) => {
        settrigger(!trigger);
      })
      .catch(function (error) {
        console.log(error);
      });
  };
  const deleteproject = (id) => {
    axios
      .delete(`http://localhost:4000/api/projects/deleteproject/${id}`)
      .then((result) => {
        settrigger(!trigger);
        console.log("deleted");
      })
      .catch(function (error) {
        console.log(error);
      });
  };
  const updateproject = (id, obj) => {
    axios
      .put(`http://localhost:4000/api/projects/updateproject/${id}`, obj)
      .then((result) => {
        navigate('/myprojects')
      })
      .catch(function (error) {
        console.log(error);
      });
  };

  return (
    <div className="card-container">
      {props.data &&
        props.data.map((e, i) => {
          return (
            <div class="card-client">
              <div class="user-picture">
                <img src={e.sreenshotLink} alt={e.name} />
              </div>
              <p class="name-client"> {e.name}</p>
              <p>{e.description} </p>
              <a href={e.viewlink}> Open the website</a>
              <br />
              <a href={e.githubLinkRepo}>Open repo on github</a>
              <button onClick={()=>{navigate('/uppdateproject')}}> update</button>
              <button onClick={()=>{deleteproject(e.idprojects)}}> delete</button>
            </div>
          );
        })}
      <button
        className="button"
        onClick={() => {
          navigate('/myprojects/addproject')

        }}
      >
        Add Project
      </button>
    </div>
  );
};

export default Myprojects;
